const styles = (theme) => ({
  row: {
    cursor: 'pointer',
  },
  createReportGroup: {
    paddingTop: theme.spacing(0.5),
  },
  pagination: {
    paddingTop: theme.spacing(0.5),
  },
  tableFilters: {
    marginTop: theme.spacing(3),
    marginBottom: theme.spacing(1),
  },
});

export default styles;
